import React from "react";
import {
  BrowserRouter as Router,
  Route,
  Routes,
  RouteComposer,
} from "react-router-dom";
import HomeScreen from "../HomeScreen";
const AppRoutes = () => {
  return (
    <Routes>
      <Route path="/" element={<HomeScreen />} />
    </Routes>
  );
};

export default AppRoutes;
